import React, {useState} from 'react';
import { HashRouter as Router, Route, Switch } from 'react-router-dom';
import Admin from '../route/admin';
import Home from '../route/home';

const AppRouter = () => {
    return (
        <Router>
            <Switch>
                {isLoggedIn ? ( 
                <>
                    <Route exact path='/'>
                        <Admin />
                    </Route>
                </>
                ) : (
                <>
                    <Route exact path='/'>
                        <Home />
                    </Route>
                </>
                )
                };
            </Switch>
        </Router>
    );};

export default AppRouter;
